import React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';
import CardMedia from '@mui/material/CardMedia';
export default function House(props) {
  const itemtitle={
    fontSize:"18px",
  }
  return (
      <div className=" flex p-3 rounded-lg  hover:shadow-lg ease-linear transition-all  ">
        <div className="flex flex-col  sm:w-fit  sm:py-2">
          <div className="flex ">
            <picture className="max-w-[200px] aspect-square m-2">
              <img
                src={`${props.url}`}
                loading="lazy"
                className="w-full h-full  shadow-lg object-cover"
              />
            </picture>
            <div class="g-info">
            <div class="item-title" style={itemtitle}>{props.name}</div>
            </div>
            {props.intro}<br></br>
            {props.price}<br></br>
            {props.score}<br></br>
          </div>
        </div>
      </div>
  );
}
